webpackJsonp([0xdeaeae9a04fd],{645:function(A,e){A.exports={data:{markdownRemark:{html:"<p>Tuva Semmingsen, mezzosopran, har studert ved Norges musikkhøgskole og ved Operaakademiet i København. Hun debuterte i 1999 på Det Kongelige Teater i København, i rollen som «Cherubino» i Figaros bryllup. I perioden 2000-2016 var hun fast medlem av solistensemblet ved Det Kongelige Teater og opptrådte bl.a. i Julius Cæsar (i rollen som «Sesto»), i Rossinis La Cenerentola («Angelina»), i Barberen i Sevilla («Rosina») og i Händels Partenope («Patria Rosmira»). Utenfor Danmark har hun bl.a. sunget i La Cenerentola («Angelina») for Glyndebourne Touring Opera og for Kungliga Operan i Stockholm, Barberen i Sevilla («Rosina») i Nancy, Reims, Lille, Bergen og Oslo.</p>\n<p>I 2017 medvirket hun i en oppsetning av den komiske operaen «Kveiteprinsen» i Kristiansand og våren 2018 som Tisbe i «La Cenerentola» på turné med Den Norske Blåseensemble i Østfold.</p>\n<p>Tuva Semmingsen kan høres på soundtracket til Lars von Triers film Antichrist sammen med tidligmusikk-ensemblet Barokksolistene under ledelse av barokkfiolinisten Bjarte Eike. Hun medvirket også på Barokksolistenes debut-CD «London Calling», der hun bl.a. fremførte Händel-arier.</p>\n<p>I 2014 ga hun ut moderne jazz-tolkninger av kjente sanger (bl.a. God Bless the Child og Les Feuilles Mortes) på CD-en Money sammen med det danske storbandet The Orchestra.  </p>\n<p>Kommende engasjement i 2018-2019 for Tuva, er blant annet som prins Orlovsky i «Flaggermusen» og rolle i «Phantom of the Opera» i Danmark. Ny plate er også på gang.</p>",timeToRead:1,excerpt:"Tuva Semmingsen, mezzosopran, har studert ved Norges musikkhøgskole og ved Operaakademiet i København. Hun debuterte i 1999 på Det Kongelige…",id:"/Users/thomasheimstad/Sites/Obo/src/posts/artister/tuva-semmingsen.md absPath of file >>> MarkdownRemark",frontmatter:{workname:null,composedin:null,startDate:null,startTime:null,location:null,artists:null,medialink:null,title:"Tuva Semmingsen",dedicatedTo:null,author:null,date:"2018-05-07T12:00:00.048Z",category:"artister",tags:["sanger"],thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:2,src:"/static/TuvaSemmingsen-32a0266b40775325715201ce54f40615-d88d8.jpg",srcSet:"/static/TuvaSemmingsen-32a0266b40775325715201ce54f40615-022af.jpg 480w,\n/static/TuvaSemmingsen-32a0266b40775325715201ce54f40615-37814.jpg 960w,\n/static/TuvaSemmingsen-32a0266b40775325715201ce54f40615-d88d8.jpg 1072w",sizes:"(max-width: 1072px) 100vw, 1072px"}}}},fields:{slug:"/artister/tuva-semmingsen/",artist:null,opuses:[{frontmatter:{title:"58",category:"opus",workname:"Norge. Dikt av John Paulsen",thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1,src:"/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-466fa.jpg",srcSet:"/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-27b23.jpg 90w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-0afbd.jpg 180w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-466fa.jpg 360w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-43088.jpg 540w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-545bd.jpg 720w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-8c1c4.jpg 1080w,\n/static/opus58-2a33fc965c6e03e20c3395a43d33e7d5-b51e2.jpg 2805w",sizes:"(max-width: 360px) 100vw, 360px"}}}},fields:{slug:"/opus58/",artist:[{frontmatter:{title:"Tuva Semmingsen",tags:["sanger"]}},{frontmatter:{title:"Joachim Kwetzinsky",tags:["pianist"]}}]}}]}}},pathContext:{slug:"/artister/tuva-semmingsen/"}}}});
